import React, { useState } from "react";
import "./ResearchPapers.css";
 import axios from "axios";
export default function ResearchPapers() {
  const [formData, setFormData] = useState({
    paperTitle: "",
    authors: "",
    correspondingAuthor: "",
    journalName: "",
    publisher: "IEEE",
    publicationType: "Journal",
    volume: "",
    issue: "",
    pageNumbers: "",
    publicationDate: "",
    citationCount: "",
    paperPdf: null,
  });

  const handleChange = (e) => {
    const { name, value, files } = e.target;
    setFormData({
      ...formData,
      [name]: files ? files[0] : value,
    });
  };

 

const handleSubmit = async (e) => {
  e.preventDefault();

  try {
    await axios.post("http://localhost:5000/api/research", {
      paperTitle: formData.paperTitle,
      authors: formData.authors,
      correspondingAuthor: formData.correspondingAuthor,
      journalName: formData.journalName,
      publisher: formData.publisher,
      publicationType: formData.publicationType,
      volume: formData.volume,
      issue: formData.issue,
      pageNumbers: formData.pageNumbers,
      publicationDate: formData.publicationDate,
      citationCount: formData.citationCount,
    });

    alert("Research Paper saved to database ✅");

    setFormData({
      paperTitle: "",
      authors: "",
      correspondingAuthor: "",
      journalName: "",
      publisher: "IEEE",
      publicationType: "Journal",
      volume: "",
      issue: "",
      pageNumbers: "",
      publicationDate: "",
      citationCount: "",
      paperPdf: null,
    });
  } catch (err) {
    console.error(err);
    alert("Error saving research paper ❌");
  }
};


  return (
    <div className="research-wrapper">
      <h3 className="section-title">Add Research Paper</h3>

      <form className="research-form" onSubmit={handleSubmit}>
        {/* Paper Title */}
        <div className="form-group">
          <label>Paper Title</label>
          <input type="text" name="paperTitle" onChange={handleChange} required />
        </div>

        {/* Authors */}
        <div className="form-group">
          <label>Authors</label>
          <input type="text" name="authors" onChange={handleChange} required />
        </div>

        {/* Corresponding Author */}
        <div className="form-group">
          <label>Corresponding Author</label>
          <input
            type="text"
            name="correspondingAuthor"
            onChange={handleChange}
            required
          />
        </div>

        {/* Journal / Conference Name */}
        <div className="form-group">
          <label>Journal / Conference Name</label>
          <input
            type="text"
            name="journalName"
            onChange={handleChange}
            required
          />
        </div>

        {/* Publisher */}
        <div className="form-group">
          <label>Publisher</label>
          <select name="publisher" onChange={handleChange}>
            <option>IEEE</option>
            <option>Springer</option>
            <option>Elsevier</option>
            <option>ACM</option>
            <option>Others</option>
          </select>
        </div>

        {/* Publication Type */}
        <div className="form-group">
          <label>Publication Type</label>
          <select name="publicationType" onChange={handleChange}>
            <option>Journal</option>
            <option>Conference</option>
          </select>
        </div>

        {/* Volume */}
        <div className="form-group">
          <label>Volume</label>
          <input type="text" name="volume" onChange={handleChange} />
        </div>

        {/* Issue */}
        <div className="form-group">
          <label>Issue</label>
          <input type="text" name="issue" onChange={handleChange} />
        </div>

        {/* Page Numbers */}
        <div className="form-group">
          <label>Page Numbers</label>
          <input type="text" name="pageNumbers" onChange={handleChange} />
        </div>

        {/* Publication Date */}
        <div className="form-group">
          <label>Publication Date</label>
          <input
            type="date"
            name="publicationDate"
            onChange={handleChange}
          />
        </div>

        {/* Citation Count */}
        <div className="form-group">
          <label>Citation Count</label>
          <input
            type="number"
            name="citationCount"
            onChange={handleChange}
          />
        </div>

        {/* Paper PDF Upload */}
        <div className="form-group full-width">
          <label>Paper PDF Upload</label>
          <input
            type="file"
            name="paperPdf"
            accept=".pdf"
            onChange={handleChange}
          />
        </div>

        {/* Submit Button */}
        <div className="full-width center">
          <button type="submit" className="submit-btn">
            Add Research Paper
          </button>
        </div>
      </form>
    </div>
  );
}
